extension String {
    
    func equalButOpposite() -> String? {
        guard count == 1 else { return nil }
        let upper = uppercased()
        let lower = lowercased()
        
        let isUpper = self == upper
        let isLower = self == lower
        
        switch (isUpper, isLower) {
        case (false, false):
            return nil
        case (false, true):
            return uppercased()
        case (true, false):
            return lowercased()
        case (true, true):
            return nil
        }
    }
    
    func reactivePair() -> String {
        guard count == 1 else { fatalError() }
        return self + self.equalButOpposite()!
    }
    
    func stripReactivePairs() -> String {
        var testSubject = self
        var reactiveValues = Set<String>()
        var hasAtLeastOneReactivePair = true
        for characterValue in Array(testSubject) {
            reactiveValues.insert(String(characterValue).reactivePair())
        }
        while hasAtLeastOneReactivePair {
            var hasAtLeastOneReactivePairLocal = false
            for pair in reactiveValues {
                if testSubject.contains(pair) {
                    hasAtLeastOneReactivePairLocal = true
                    testSubject = testSubject.replacingOccurrences(of: pair, with: "")
                }
            }
            hasAtLeastOneReactivePair = hasAtLeastOneReactivePairLocal
        }
        
        return testSubject
    }
    
}

extension Year2018 {
    
    final class Day5: Day {
        
        required init() { }
        
        private let poly = ""
        
        func part1() -> String {
            return String(poly.stripReactivePairs().count)
        }
        
        func part2() -> String {
            let allLetters = Set(Array(poly))
            var answers = [String: Int]()
            for letter in allLetters {
                let modifiedPoly = poly.replacingOccurrences(of: String(letter), with: "").replacingOccurrences(of: String(letter).equalButOpposite()!, with: "")
                answers.updateValue(modifiedPoly.stripReactivePairs().count, forKey: String(letter))
            }
            let minLength = answers.values.sorted().first!
            
            return String(minLength)
        }
        
    }
    
}
